import logo from "./logo.svg";
import "./App.css";

// 【props：向组件传递数据】
const Hello = (props, loops) => {
  const currentDate = new Date();
  const a = 10;
  const b = 23;
  return (
    <div>
      <p>Hello world</p>
      <p> heeeello world, it is now {currentDate.toDateString()}</p>
      <p>
        {a} plus {b} is {a + b}
      </p>
    </div>
  );
};
function App() {
  console.log("loopring goes to the moon!");
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <Hello />
        <Hello />
      </header>
    </div>
  );
}

export default App;
